import React from 'react'
import Revenue from './Card_assets/Icons_1.png'

const Vcard = ({codes}) => {
    
  return (
    <div class='basis-1/2 flex p-2 pl-4 '>
       <div> <img src={Revenue} alt="revenue" class='bg-white rounded-full w-6 h-6 items-center'></img></div>
       <div class='ml-2'> <div class='text-sm font-bold'>{codes.num}</div>
        <div class='text-xs '>{codes.text}</div></div>
    </div>
  )
}

export default Vcard
